// React
import React from "react";

//Import CSS
import "./WelcomeCard.css";


const WelcomeCard = () => {
  return (
    <div className="welcome_wrapper">
        <h1>Live Life Better</h1>
        <h2>Live Life Better</h2>
        <p>
            <button>Our Services</button>
        </p>
    </div>
  );
};

export default WelcomeCard;
